import './App.css';
import Header from './components/Header/header.js';
import Section from './components/Section/section.js';
import ProjectCard from './components/ProjectCard/projectCard.js';

const socialLinks = [
  { id: 1, name: 'Wikipedia', url: 'https://pt.wikipedia.org/wiki/Nikola_Tesla', icon: '/icons/linkedin-electric.svg'},
  { id: 2, name: 'Instagram', url: 'https://github.com/phelipesena', icon: '/icons/github-electric.svg' },
];

function App() {
  return (
    <div className="App">
      <Header/>
    </div>
  );
}

export default App;
